import React, { Component } from 'react';
import EventTab from './eventTab';
//props:
// fixture a list of objects where each object is an event
class EventTabs extends Component {

    render() { 
        return (
            <React.Fragment>
                {
                    this.props.fixture.map( event => {
                        <div key={ event.id } class="eventTab">
                            <EventTab key={event.id} 
                            data = {event}/>
                        </div>

                    })
                }
            </React.Fragment>
        );
    }
}

export default EventTabs;
